import React from 'react'

import CollectionPreview from '../../components/collection-preview/collection-preview'

const ShopPage = ({ collections }) => (
  <>
    {
      collections.map(({ id, ...otherProps}) => (
        <CollectionPreview 
          key={id}
          {...otherProps}
        />
      ))
    }
  </>
)

export default ShopPage
